import http from "./http-common";

function systemlogs(token){
    return http.
        post("/getloggedusers/", {
            token,
        })
        .then(response => {
            return response.data;
        })
        .catch(error => console.log(error));
}

function mongodiskuse(){
    return http.
        post("/getmongodiskuse/", {})
        .then(responsive => {
            return responsive;
        })
        .catch(error => console.log(error));
}

const endpoint = {
    systemlogs,
    mongodiskuse,
};

export default endpoint;
